import React from 'react';

const ToDo = ({todo, handleToggle}) => {

    const handleClick = (e) => {
        e.preventDefalt()
        handleToggle(e.currentTarget.id)
    }

    return(
        <div id={todo.id} key={todo.id + todo.task} className={todo.complete ? "strike" : "hit"} onClick={handleClick}> 
            {todo.task}
        </div>
    );
};

export default ToDo;
